// Código simple para n8n - Dividir el mensaje en 3 partes
// Para usar en un nodo Function de n8n

function processItem(item) {
  // Obtener el mensaje original
  const mensaje = item.json.output || "";

  // Calcular la longitud aproximada de cada parte
  const longitud = mensaje.length;
  const longitudParte = Math.ceil(longitud / 3);

  // Dividir el mensaje en 3 partes
  const parte1 = mensaje.substring(0, longitudParte);
  const parte2 = mensaje.substring(longitudParte, longitudParte * 2);
  const parte3 = mensaje.substring(longitudParte * 2);

  // Guardar las partes en el objeto item.json
  item.json.parte1 = parte1;
  item.json.parte2 = parte2;
  item.json.parte3 = parte3;

  return item;
}

